import './App.css';
import {Button,alert} from 'react-bootstrap/Button';
import 'bootstrap/dist/css/bootstrap.min.css';
let List = [<h1>1</h1>, 2, 4, 5]
let count=5
function App() {
  return (

    <div className="App">
      <header className="App-header">
        <Button as="a" variant="success">
          Enter
        </Button>
        {List}

{count>5?<alert variant="success">sucess</alert>:<alert variant="danger">failure</alert>}
      </header>
    </div>
  );
}

export default App;
